import React from 'react';
import AppLayout from '../components/AppLayout';
import Link from 'next/link'

const Home = () => {
    return (
        <AppLayout>
            <Link href="/"><a>노드버드</a></Link>
        </AppLayout>
    );
}

export default Home;
